import React, { useEffect, useState } from 'react';
import getDataFromApi from '../services/api';

getDataFromApi();
const App = () => {
  const [quote, setQuote] = useState([]);

  useEffect(() => {
    getDataFromApi().then((data) => setQuote(data));
  }, []);

  return (
    <main><p>Esta es una prueba</p></main>
  );
};

export default App;
